PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "Placowka" (
    "id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
    "nazwa" TEXT NOT NULL,
    "typ_placowki" TEXT NOT NULL,
    "prowadzacy" TEXT,
    "ulica" TEXT,
    "miejscowosc" TEXT NOT NULL,
    "kod_pocztowy" TEXT,
    "gmina" TEXT,
    "powiat" TEXT NOT NULL,
    "wojewodztwo" TEXT NOT NULL,
    "telefon" TEXT,
    "email" TEXT,
    "www" TEXT,
    "liczba_miejsc" INTEGER,
    "profil_opieki" TEXT,
    "koszt_pobytu" REAL,
    "data_aktualizacji" DATETIME,
    "zrodlo" TEXT,
    "latitude" REAL,
    "longitude" REAL,
    "createdAt" DATETIME NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updatedAt" DATETIME NOT NULL
);
CREATE TABLE IF NOT EXISTS "TerytLocation" (
    "id" INTEGER NOT NULL PRIMARY KEY AUTOINCREMENT,
    "nazwa" TEXT NOT NULL,
    "nazwa_normalized" TEXT NOT NULL,
    "typ" TEXT NOT NULL,
    "gmina" TEXT,
    "powiat" TEXT NOT NULL,
    "wojewodztwo" TEXT NOT NULL
);
DELETE FROM sqlite_sequence;
CREATE INDEX "Placowka_powiat_idx" ON "Placowka"("powiat");
CREATE INDEX "Placowka_wojewodztwo_idx" ON "Placowka"("wojewodztwo");
CREATE INDEX "Placowka_typ_placowki_idx" ON "Placowka"("typ_placowki");
CREATE INDEX "TerytLocation_nazwa_normalized_idx" ON "TerytLocation"("nazwa_normalized");
CREATE INDEX "TerytLocation_powiat_idx" ON "TerytLocation"("powiat");
CREATE INDEX "TerytLocation_wojewodztwo_idx" ON "TerytLocation"("wojewodztwo");
COMMIT;
